DROP TABLE IF EXISTS motoboy;

CREATE TABLE `motoboy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bairro` varchar(100) NOT NULL,
  `cidade` varchar(100) NOT NULL,
